import React, { Component } from 'react'
export default class dashboard extends Component {
    render() {
        return (
            <React.Fragment>
                <header>
                    <h1>
                        welcome user
                        <button onClick={this.props.submitFrom}>logout</button>
                    </h1>
                </header>
            </React.Fragment>
        )
    }
}
